import Task from "./Task";



const Tasks = ({task}) => {

  return (
    <>
      {tasks.map((task, i) => (
      <div className="task" key={task.id}>
         <Task
            id={task.id}
            text={task.text}
            day={task.day}
            reminder={task.reminder}
          />
        </div>
      ))}
    </>
  );
};

export default Tasks;
